webpackJsonp([0xcd91a5a74ee3],{6215:function(e,t){e.exports={data:{post:{html:'<p>Interesting that the current top two entries on the <a title="Kultur - SPIEGEL ONLINE" href="http://www.spiegel.de/kultur/charts/0,1518,sachbuch,00.html">Spiegel non-fiction bestseller list</a> are both American,  namely Michael Moore "Stupid White Men" and Hillary Clinton "Living History" (and number 7 is Emmanuel Todd "World Power USA: An Obituary", a book I\'m not familiar with but the title seems to say it all).  My conclusion: Germans are very interested in reading about the United States, but only to have their prejudices confirmed.</p>',fields:{title:"Stupid White Men and Women",date:"08 Jul 2003",url:"https://papascott.de/2003-07-08-stupid-white-men-and-women/"}}},pathContext:{slug:"/2003-07-08-stupid-white-men-and-women/",prev:{fields:{title:"One Hand Clapping: My Beta TypePad Blog",date:"08 Jul 2003",slug:"/2003-07-08-one-hand-clapping-my-beta-typepad-blog/"}},next:{fields:{title:"Waiting in the Shower",date:"08 Jul 2003",slug:"/2003-07-08-waiting-in-the-shower/"}}}}}});
